import logo from './logo.svg';
import './Login.css';
import { createMuiTheme,ThemeProvider  } from '@material-ui/core/styles';
import React from "react";
import {
Button,
TextField,
Grid,
Paper,
AppBar,
Typography,
Toolbar,
Link,
} from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
const useStyles = makeStyles((theme) => ({
  customBorderRadius: {
    borderRadius: 5,
    width: '396px',
    padding: '20px 0px 28px',
    margin: '45% auto',
    textAlign: 'center',
    alignItems: 'center',
  },
  customTextBox:
  {
    width: '90%',
  }
}));

const theme = createMuiTheme({
  typography: {
    fontFamily: ['"Montserrat"'].join(',')
   }
 })


function Login() {
  const classes = useStyles();

  return (
    <div className="main">
      <head><link href="https://fonts.googleapis.com/css2?family=Montserrat&display=swap" rel="stylesheet"/></head>
      <Grid container justify="center" direction="row" className="login-form">
      <Grid item>
          <Grid container justify="center" direction="column" className="logo-comp">
            <Grid item>
              <img src={logo} className="App-logo" alt="logo" />
            </Grid>
            <Grid item>
              <h1 class="large">
              ipon.app
              </h1>
            </Grid>
            <Grid item>
            <p class="tag-large">
            Simplest way to track your expenses.
            </p>
            </Grid>

            <Grid item>
            <p class="tag-next-large">
              Because every peso counts.
            </p>
            </Grid>
          </Grid>
        </Grid>
        <Grid item>
        <ThemeProvider theme={theme}>
          <Paper variant="elevation" elevation={10} className={classes.customBorderRadius}>
            <Grid container direction="column" spacing={2} >
              <Grid item>
                <TextField
                  id="outlined-email"
                  label="Email"
                  variant="outlined"
                  className = {classes.customTextBox}
                />
              </Grid>
              <Grid item>
                <TextField
                  id="outlined-pw"
                  label="Password"
                  type="password"
                  variant="outlined"
                  className = {classes.customTextBox}
                />
              </Grid>
            </Grid>
          </Paper>
          </ThemeProvider>
        </Grid>
      </Grid>
  </div>
  );
}

export default Login;
